import React, {Component} from 'react'; //Mayuscula minuscula

class Navegacion extends Component{
    render(){
        return(
            <div className="container">
                <nav className="nav navbar navbar-dark bg-dark">
                    <a className="nav-link active" href="#">Hola {this.props.nombre}</a>
                    <a className="nav-link" href="#">Menu {this.props.nombre}</a>
                    <a className="nav-link disabled" href="#">Salir de {this.props.nombre}</a>
                </nav>
            </div>
            );
    }
}

export default Navegacion;
